import VehicleCard from './VechicleCard';
import Container from 'react-bootstrap/Container';

class Vehicles extends React.Component{
    constructor(props){
        super(props);
        this.state={
          vehicles:[]
        }
      }
      componentDidMount(){
        fetch('http://localhost:8081/api/get')
        .then(res=>res.json())
        .then((data)=>{
            this.setState({vehicles : data})
            console.log(data)
        }).catch(console.log) 
    }
      render(){ 
        return(
          <Container>
                <VehicleItem vehicles={this.state.vehicles}/>
          </Container>
     
        );
      
      }

}
